const e={January:"January",February:"February",March:"March",April:"April",May:"May",June:"June",July:"July",August:"August",September:"September",October:"October",November:"November",December:"December",Present:"Present",Studying:"Studying"},o={roleName:"Fullstack Developer"},a={Experience:"Experience",AboutMe:"About Me",Contact:"Contact",Blog:"Blog",Education:"Education"},n={text:"A developer passionate about research and development. Who mastered different languages and tools, delivering clean, secure, and reliable code. Thus, advancing projects, building technologies, and creating a better product."},i={text:"Since my introduction to my first computer at age 7, I've been enthralled by the intricate workings of technology. From those early moments, I started developing my skills in diverse programming languages and building a range of software, progressing from automating tasks in Python to creating simple games by the age of 12.<br /><br />At 16, I embarked on a unique educational journey, pursuing a technical IT degree intertwined with my high school studies. Over four formative years at IFRS, I flourished as a teaching assistant, immersing myself in a variety of projects spanning from engaging game development to the complexities of neural networks. Concurrently, I undertook a significant challenge—designing a scalable backend solution for 'Farmácia Solidária.' Leveraging cutting-edge technologies such as microservices and asynchronous communication in Kafka.<br /><br />Continuing my educational journey, I'm pursuing a graduation course in System Development and Analysis at IFRS, building upon the foundation I had laid during my earlier years at the institution. Simultaneously, I embarked on a parallel pursuit, delving into the vast realm of Computer Science at Unisinos. This way of pursuing two graduations in the same field allowed me to fuse theoretical insights from my foundation in Computer Science with practical applications in System Development and Analysis, enriching my understanding of complex systems and their real-world implications. Navigating between the two academic landscapes, I'm enhancing my problem-solving skills, deepening my grasp of programming paradigms, and embracing a holistic approach to software development. This harmonious educational synergy propelled me to new heights of proficiency and positioned me to contribute meaningfully to the ever-evolving tech landscape."},s={wip:"Still working on the blog feature"},t={text:"Please, don't hesitate in contact me for any inquiries, discoussions, or opportunities you think I would be a good fit. You can find me at any of these options below. I'm looking forward to work with you soon!",email:"contact{'@'}otavioh.dev"},r={roleName:{systemDeveloper:"System Developer",backendDeveloperAndResearcher:"Backend Developer and Researcher",AIDeveloperAndResearcher:"AI Developer and Researcher",teachingAssistant:"Teaching Assistant"},description:{colomboSystemDeveloper:"Develop applications using C#, .NET, JavaScript, Typescript, X++; Manage databases using SQL Server; Deploy applications using Azure CI/CD and Docker.",ifrsBackendDeveloper:"Develop a backend system from scratch, that could expand vertically and horizontally. Developed using Python, Django, Docker, Docker Compose, Kafka.",ifrsAIDeveloper:"Started developing an AI that would reduce academic evasion. Developed using Python, Keras, TensorFlow.",ifrsTeachingAssistant:"Helped students at Programming I and II. Subjects I helped were Python, PyGame, Java, JavaFx, SQL."}},c={roleName:{unisinosComputerScience:"Computer Science Student",ifrsSystemsAnalysis:"Systems Analysis and Development Student",ifrsHighSchool:"High School - Technical Degree in Information Technology",talkersAdvancedEnglish:"Advanced English Student",icaaElementarySchool:"Elementary School"},description:{unisinosComputerScience:"",ifrsSystemsAnalysis:"",ifrsHighSchool:"",talkersAdvancedEnglish:"",icaaElementarySchool:""}},d={months:e,topHeader:o,portfolioContent:a,home:n,about:i,blog:s,contact:t,experience:r,education:c},l={January:"Janeiro",February:"Fevereiro",March:"Março",April:"Abril",May:"Maio",June:"Junho",July:"Julho",August:"Agosto",September:"Setembro",October:"Outubro",November:"Novembro",December:"Dezembro",Present:"Atuando",Studying:"Estudando"},m={roleName:"Desenvolvedor Fullstack"},u={Experience:"Experiência",AboutMe:"Sobre mim",Contact:"Contato",Blog:"Blog",Education:"Educação"},p={text:"Um programador apaixonado por pesquisa e implementação. Dominando diversas linguagens e ferramentas, entregando um código limpo, seguro e confiável. Assim, avançando projetos, construindo tecnologias e criando um produto melhor."},g={text:"Desde minha introdução ao meu primeiro computador aos 7 anos, fui cativado pelas complexas operações da tecnologia. Aos 12 anos, comecei a desenvolver minhas habilidades em diversas linguagens de programação e construir uma variedade de softwares, progredindo de tarefas automatizadas em Python para a criação de jogos simples.<br /><br />Aos 16 anos, iniciei uma jornada educacional única, buscando um diploma técnico em Tecnologia da Informação entrelaçado aos meus estudos no ensino médio. Durante quatro anos formativos no IFRS, destaquei-me como monitor de programação, imergindo-me em uma variedade de projetos que abrangem desde o envolvente desenvolvimento de jogos até as complexidades das redes neurais. Ao final, assumi um desafio significativo: projetar uma solução de backend escalável para a 'Farmácia Solidária'. Utilizando tecnologias de ponta, como microsserviços e comunicação assíncrona com Kafka.<br /><br />Continuando minha jornada educacional, estou cursando Desenvolvimento e Análise de Sistemas no IFRS, ampliando a base que havia estabelecido durante meus anos anteriores na instituição. Ao mesmo tempo, iniciei uma busca paralela, explorando o vasto campo da Ciência da Computação na Unisinos. Essa maneira de perseguir duas graduações no mesmo campo me permitiu unir a base em Ciência da Computação com aplicações práticas em Desenvolvimento e Análise de Sistemas, enriquecendo minha compreensão de sistemas complexos e suas implicações no mundo real. Navegando entre essas duas graduações, continuo aprimorando minhas habilidades de resolução de problemas, aprofundei minha compreensão de paradigmas de programação e abracei uma abordagem holística para o desenvolvimento de software. Essa harmoniosa sinergia educacional me impulsionou a novos patamares de proficiência e me posicionou para contribuir de maneira significativa para o cenário tecnológico em constante evolução."},v={wip:"Ainda trabalhando na funcionalidade do blog."},h={text:"Por favor, não hesite em entrar em contato comigo para quaisquer dúvidas, discussões ou oportunidades em que você ache que eu possa ser uma boa opção. Você pode me encontrar em qualquer uma das opções abaixo. Ansioso para trabalhar com você em breve!",email:"contato{'@'}otavioh.dev"},b={roleName:{systemDeveloper:"Desenvolvedor de sistemas",backendDeveloperAndResearcher:"Desenvolvedor Backend e Pesquisador",AIDeveloperAndResearcher:"Desenvolvedor de IA e Pesquisador",teachingAssistant:"Monitor de Programação"},description:{colomboSystemDeveloper:"Desenvolver aplicações com C#, .NET, JavaScript, Typescript, X++;Gerenciar banco de dados SQL Server;Implantar aplicações utilizando  Azure CI/CD e Docker.",ifrsBackendDeveloper:"Desenvolver um sistema do zero que fosse possível de escalar horizontalmente e verticalmente.Desenvolvido usando Python, Django, Docker, Docker Compose, Kafka.Este projeto resultou neste <a href='https://docs.google.com/document/d/1XblMbza7AYW_O4I9bjA9yD5jQJb3AZ4eXO7d4rNfYBM/edit?usp=sharing'>artigo</a>.",ifrsAIDeveloper:"Comecei a desenvolver uma IA que ajudasse contra a evasão escolar.Desenvolvido usando Python, Keras, TensorFlow.",ifrsTeachingAssistant:"Ajudava estudantes de programação I e II. Assuntos com os quais eu ajudava  Python, PyGame, Java, JavaFx, SQL."}},y={roleName:{unisinosComputerScience:"Ciências da Computação",ifrsSystemsAnalysis:"Analise e Desenvolvimento de Sistemas",ifrsHighSchool:"Ensino Médio - Técnico em Informática",talkersAdvancedEnglish:"Inglês Avançado",icaaElementarySchool:"Ensino Fundamental"},description:{unisinosComputerScience:"",ifrsSystemsAnalysis:"",ifrsHighSchool:"",talkersAdvancedEnglish:"",icaaElementarySchool:""}},f={months:l,topHeader:m,portfolioContent:u,home:p,about:g,blog:v,contact:h,experience:b,education:y},A=()=>({locale:"pt-BR",warnHtmlMessage:!1,messages:{en:d,"pt-BR":f}});export{A as default};
